import './Service.css';
import axios from 'axios';
import Board_header from "./../Board_header/Board_header";
import Board_list from "./../Board_list/Board_list.js";
function Service_Total(){
    window.onload = axios({
        method: "get",
        url: "http://54.180.210.232/api/v1/services/all",
        headers: {
            "Content-Type": "application/json",
            Authorization: "Bearer eyJhbGciOiJIUzUxMiJ9.eyJzdWIiOiJleGFtcGxlQGV4YW1wbGUuY29tIiwiYXV0aCI6IlJPTEVfQ0xBU1NJQyIsImV4cCI6MTY3MTg2Mzk2MH0.X4X7iyPGYZy-HR3dHv3ngq53dGV2Zy5NpXwYTlClWe8fWgQQaOFM5MVgBY8LaA8PX1kzLXhB5yg-JjtIxDZ68g"
        },
    }).then((res) => {
        setUsers(res.data.result.name);
        setRoles(res.data.result.role);
    }).catch((error) => {
        alert("정보를 가져올 수 없습니다");
    });
    return(
        <div>
            <Board_header t1="번호" t2="제목" t3="글쓴이" />
            <ul>
                {content===Object(content)
                    ? content.content.map((content, index) => (
                        <li key={index}>
                            <Board_list num={index+1} title={content.title} name={content.writer} />
                        </li>
                    ))
                    : "등록된 글이 없습니다"}
            </ul>
        </div>
    );
}

export default Service_Total;
